import React, { useState } from "react";

import Story from '../../components/Story';

import './Stories.scss';

const Stories = ({ stories, getUserHandler }) => {
  return (
    <React.Fragment>
      <section className="stories">
        <div className="container">
          <figure className="user__thumb">
              <img className="user__thumb__wrapper" src="https://viniciusvinna.netlify.app/assets//api-instagram/profiles/black-panther/black-panther-profile.jpg"></img>
          </figure>
        </div>
      </section>

      {//showStory 
      true && (
        <Story />
        )}
    </React.Fragment>
  );
};

export default Stories;
